webpackJsonp([28499958762261],{8020:function(e,a){e.exports={data:{post:{html:'<p>In her managerial career I bet Frauke flew over a hundred times to Munich and back, and experienced many rough landings. But nothing like <a href="http://www.liveleak.com/view?i=ddb_1204404185">this Lufthansa flight</a> from Munich landing in Hamburg this past weekend, yet another reason to be thankful she now stays close to home. (Via <a href="http://sprechblase.wordpress.com/2008/03/02/approaching-hamburg-airport/">Cem</a> and <a href="http://vowe.net/archives/009234.html">Volker</a>)</p>\n<p><embed src="http://www.liveleak.com/player.swf" width="450" height="370" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" flashvars="autostart=false&token=ddb_1204404185" scale="showall" name="index"></embed></p>',fields:{title:"She Doesn't Fly Anymore",date:"03 Mar 2008",url:"https://papascott.de/2008-03-03-she-doesnt-fly-anymore/"}}},pathContext:{slug:"/2008-03-03-she-doesnt-fly-anymore/",prev:{fields:{title:"We Need The Eggs",date:"01 Mar 2008",slug:"/2008-03-01-we-need-the-eggs/"}},next:{fields:{title:"Vandalism",date:"10 Mar 2008",slug:"/2008-03-10-vandalism/"}}}}}});
